import React from 'react';
import "./css/watchparty.css";

const Host = () => {
	return (
		<>
			<body class="home">
				<div>
					<div class="title_text">
						<h1 class="title">Erstellen sie einen eigenen Raum für ihre Watchparty!</h1>
					</div>
					<div class="welcome_text">
						<p class="textbox">Genieße barrierefreie Unterhaltung zusammen mit deinen Freunden bei Watch2Gether der Hochschule Anhalt dank:</p>
					</div>
					<div >
                        <input type="text" name="roomname" class="input_box" placeholder="Raumnamen eingeben"></input>
                   
						<button onClick={event => window.location.href = '/Watchparty'} className="host_button">Raum erstellen</button>
					</div>
				</div>
			</body>
		</>
	);
};

export default Host;
